	(176, 1342, 'Ceci est le test pour 1.8.3'),
	(177, 1346, 'Test 1.8.3 fr'),
	(178, 1347, 'Test suggestions'),
	(179, 1354, 'Application EXTRAORDINAIRE.\n\nUn très très gros merci à mes deux fantastiques docteurs, dr Hijal et Asselah qui m’ont permis dès le début de mes traitements de participer à l’intégration de cette application.\nJe tiens aussi à souligner le support inconditionnel de l’équipe du service de l’informatique, responsable de cette application.\n\nToutes les informations inscrites dans mon dossier m’ont faciliter grandement toutes les étapes du traitement de chimiothérapie. Que ce soit pour la confirmation très rapide de tous mes rendez-vous ou pour les résultats de prises sanguines, ou pour la facilité des enregistrements sur place, cette application est un must pour tous.\nJ’ai moi-même publisciser votre application à d’autres services de l’hopital et à d’autres patients et tous y voyaient une grande avancée pour nous faciliter l’accès à toutes ses informations si primordiales dans notre traitement.\n\nVous savez, avoir le cancer n’est pas chose facile mais quand on nous donne des outils qui nous permettent de suivre et d’avoir un meilleur contrôle avec nos résultats et nos médecins traitants,  et bien cette étape ajoute une petite douceur extrêmement agréable.\nEn espérant que vous pourrez continuer à developper à son maximum cette application et que vous aurez tout le support administratif et monétaire en ce sens.\n\nMerci de m’avoir inclus dans votre vision et n’hésitez jamais à ma demander du feed back, vous m’avez offert une grande opportunité.\nManon Laliberté \nChampagne_41@hotmail.com\n514.608.1540'),
	(180, 1369, 'Test 2018-02-04 English'),
	(181, 1370, 'Test 2018-02-04 English'),
	(182, 1421, 'On some occasions the app did not notify me that my appointment was ready. As a result I always sat in the waiting room to wait to be called because I did not trust the app. Sometimes it called me and sometimes it did not. I was unable to leave the waiting room. \n\nIn addition the app shows my next appointment with the radiologist as being in the same area as the treatments when in fact it is in another floor'),
	(183, 1439, 'I would to have easier login since quite long to re-enter information each time. The app does not work with hospital wi-fi, is there a reason for that? How can we clear notifications? The history always remains? Other functions such as medical team hard to evaluate since still incomplete the information hosted there.'),
	(184, 1452, 'Some of the features in your list of questionnaire aren’t there, at least on my case, like clinical notes, contacts with clinicians, even with education articles. Even though I have signed up for all the information to be there. \n\nIt’s very useful for me to check in with my radiation appointment and to know when my appointments are. \n\nPlease keep working on it to make it better. Thank you all for your hard work!'),
	(185, 1459, 'Opal is very useful. I use appointment notification and check in often. And also lab results .. I will appreciate if my radiation results such as CT, MRI, ultrasound results could be added on ...\n\nThank you very much!'),
	(186, 1466, 'Having appointments appear in the calendar with the names of the Dr and their contact information is very useful and a stress relief for someone going through a serious illness.'),
	(187, 1473, 'In my case, the app was inaccessible on my Iphone and Ipad due the older versions of my technology. The only way I was able to use the app was on my husband’s IPad because it was a new model. As a result, I did find it useful to see that the times of my appointments were modified from what I had been originally told, and sometimes only a few days before the appointment. It took me awhile to figure this out, as no one had told me I would not be called by phone if the time changed. As well, it was inconvenient, as I could only access this Ipad when my husband was actually at home,so I could not use it at the hospital to checkin for my appointment.\n\nOnce I accessed the app, I found the information limited. I would have liked to see more clinical notes, scans etc. The app itself seems friendly,easy to use, and the design and look are very appealing. I like the colours.I see this manner of communicating with patients very useful, assuming doctors and staff are uploading their notes and records too. Otherwise, it becomes more of an appointment scheduler.\n\nAs for the issue of my not having access due to my technology, I think this presents a problem. If I had had the option of loging in via a website I could have used the technology via the web,even at the hospital.Not everyone has the latest technology, with the exception of the 18-35 year old group. 50 yr olds and higher may have older technology,but are likely to be very interested in all the clinical notes and documents related to their health.\n\nSo in summary, find a solution to your technology issue and ensure everyone is uploading all documents in a timely manner,plus communicate clearly on what the technology can and cannot do.\n\nThat being said, I would be happy to do any other testing after my treatment is done should you need volunteers.\n\nRegards,\nMargot Wright'),
	(188, 1486, 'I have some tests at the MGH and I dont see it in my appointments, I would like to see them since they were requested by my oncologist.'),
	(189, 1493, 'Very easy to use and very useful.'),
	(190, 1511, 'I am a new patient and I haven\'t seen all the features or information yet. My feedback is limited to what I\'ve seen so far. I like the idea of information availability.'),
	(191, 1540, 'There is still information missing such as the clinical notes, my treatment plan, my medical team.'),
	(192, 1547, 'My chart and team is not complete. \nMy oncologist is missing and I have already completed radiation but doesn’t appear. \n\nYour missing Dr. Azoulay’s title in her name.\n\n\nI understand that the app is still in development stage'),
	(193, 1554, 'Non'),
	(194, 1597, 'Testing'),
	(195, 1598, 'Testing 2');
